import React from 'react'
import { useEffect, useState, useContext } from 'react';
import axios from 'axios';
import { BASEURL } from './baseURL';
import { useNavigate } from 'react-router-dom';
import { AppContext } from './App';


function PatientHomePage() {

    const {id, patientId, setPatientId} = useContext(AppContext);

    useEffect(()=>{
        const profileDetails = async() =>{
            try {
                const response = await axios.get(BASEURL + `/profile/patient_profile_details/${id}`);
                console.log(response);
                localStorage.setItem("patient_id",JSON.stringify(response.data["id"]));
                setPatientId(response.data["id"]);
                console.log(`${patientId} from home page `);
            } catch(error){
                console.error(error);
            }};
            profileDetails();
        }, [])
    

  return (
    <div>PatientHomePage</div>
  )
}

export default PatientHomePage
